import React from "react";

const Contact = () => {
  return (
    <section className="p-12 bg-gray-100 text-center">
      <h2 className="text-3xl font-bold text-gray-800">Contact Us</h2>
      <p className="text-gray-600 mt-4">üìç Address: 123 Health Street, City</p>
      <p className="text-gray-600">üìß Email: support@medicare.com</p>
      <p className="text-gray-600">üìû Phone: +123 456 7890</p>
      <div className="mt-4 space-x-4">
        <a href="#" className="text-blue-600">Twitter</a>
        <a href="#" className="text-blue-600">Instagram</a>
        <a href="#" className="text-blue-600">Facebook</a>
      </div>
    </section>
  );
};

export default Contact;
